import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const message = "hello sir"

  [wiches, setwiches] = useState([])
  fetch('/getwich')
    .then(response => response.json())
    .then(data => setwiches(data))

  return (
    <div className="App">
        <p>{message}</p>
    </div>
  );
}

export default App;
